// SPDX-License-Identifier: Public Domain
pragma solidity >=0.7.0 <0.9.0;

contract Groth16Verifier {
    // Scalar field size
    uint256 constant r =
        21888242871839275222246405745257275088548364400416034343698204186575808495617;
    // Base field size
    uint256 constant q =
        21888242871839275222246405745257275088696311157297823662689037894645226208583;

    // Verification Key data (pre-generated constants used to verify proofs)
    uint256 constant alphax =
        5627901282071799227030646873508587691139634303227870420665722652427859945036;
    uint256 constant alphay =
        12859832793189521390397557045105985811497102857919953673175044809689551308518;
    uint256 constant betax1 =
        18169119622599211836113631769973751469705302371257923176915945421308978582888;
    uint256 constant betax2 =
        4723463756284487137931228744231831594739558777745393351109945043081565847062;
    uint256 constant betay1 =
        8071004379064808128450757237033496806828656216879032532563470301017968080498;
    uint256 constant betay2 =
        11581074587900538946006650427055266939613269850109914378361302147590423103545;
    uint256 constant gammax1 =
        11559732032986387107991004021392285783925812861821192530917403151452391805634;
    uint256 constant gammax2 =
        10857046999023057135944570762232829481370756359578518086990519993285655852781;
    uint256 constant gammay1 =
        4082367875863433681332203403145435568316851327593401208105741076214120093531;
    uint256 constant gammay2 =
        8495653923123431417604973247489272438418190587263600148770280649306958101930;
    uint256 constant deltax1 =
        20017212368215985547510252084308832312727437968791929835809906224588960329401;
    uint256 constant deltax2 =
        20426197228371586237177566794778588631424006983832144585137201464447969219953;
    uint256 constant deltay1 =
        18022186172436739763495155339088761640744077326705100872392254342113338758773;
    uint256 constant deltay2 =
        17723844454434927619894629026652233139818054192420976830932245112190288364103;

    // Input coefficients for public signals (used to reconstruct vk_x)
    uint256 constant IC0x =
        5326716233353311561439894393850638375037647250140070857315286214920007401789;
    uint256 constant IC0y =
        13111490370089849027801919404198558319392497585659954961591569719284575729959;
    uint256 constant IC1x =
        3024335090342612085439861866022796963619833600085105571382896518505310520201;
    uint256 constant IC1y =
        10475817078277548447463349758992004093577602796033868412484095734211872560153;
    uint256 constant IC2x =
        20935753118114673449966514650975470871717355218305678063849078933691835620741;
    uint256 constant IC2y =
        12641648887274044399100256937649204814379966957936949606223143640942582886154;
    uint256 constant IC3x =
        13029499626925449358242062306433891146904388891468196190433805345896387246428;
    uint256 constant IC3y =
        11904528700554136917370103471774336115651045788308459908859161410660292894172;
    uint256 constant IC4x =
        1425962524415380483212737620363170968136633123323357771571526928472336526011;
    uint256 constant IC4y =
        17861082010844052865412295437045724577844249407082293166315744960989129955116;

    // Memory layout positions
    uint16 constant pVk = 0;
    uint16 constant pPairing = 128;
    uint16 constant pLastMem = 896;

    /// @notice Verifies a Groth16 zk-SNARK proof using the preloaded verification key.
    /// @param _pA G1 element from proof A
    /// @param _pB G2 element from proof B
    /// @param _pC G1 element from proof C
    /// @param _pubSignals Array of public signals to be verified
    /// @return True if the proof is valid, false otherwise
    function verifyProof(
        uint[2] calldata _pA,
        uint[2][2] calldata _pB,
        uint[2] calldata _pC,
        uint[4] calldata _pubSignals
    ) public view returns (bool) {
        assembly {
            // Internal function to ensure a value is within the finite field
            function checkField(v) {
                if iszero(lt(v, r)) {
                    mstore(0, 0)
                    return(0, 0x20)
                }
            }

            // Multiply G1 point by scalar and accumulate result into memory at pR
            function g1_mulAccC(pR, x, y, s) {
                let success
                let mIn := mload(0x40)
                mstore(mIn, x)
                mstore(add(mIn, 32), y)
                mstore(add(mIn, 64), s)

                success := staticcall(sub(gas(), 2000), 7, mIn, 96, mIn, 64)

                if iszero(success) {
                    mstore(0, 0)
                    return(0, 0x20)
                }

                mstore(add(mIn, 64), mload(pR))
                mstore(add(mIn, 96), mload(add(pR, 32)))

                success := staticcall(sub(gas(), 2000), 6, mIn, 128, pR, 64)

                if iszero(success) {
                    mstore(0, 0)
                    return(0, 0x20)
                }
            }

            // Constructs pairing input and calls precompiled verifier
            function checkPairing(pA, pB, pC, pubSignals, pMem) -> isOk {
                let _pPairing := add(pMem, pPairing)
                let _pVk := add(pMem, pVk)

                // Build vk_x from linear combination of IC points and pubSignals
                mstore(_pVk, IC0x)
                mstore(add(_pVk, 32), IC0y)
                g1_mulAccC(_pVk, IC1x, IC1y, calldataload(add(pubSignals, 0)))
                g1_mulAccC(_pVk, IC2x, IC2y, calldataload(add(pubSignals, 32)))
                g1_mulAccC(_pVk, IC3x, IC3y, calldataload(add(pubSignals, 64)))
                g1_mulAccC(_pVk, IC4x, IC4y, calldataload(add(pubSignals, 96)))

                // Construct the pairing input in memory
                mstore(_pPairing, calldataload(pA))
                mstore(add(_pPairing, 32), mod(sub(q, calldataload(add(pA, 32))), q))

                mstore(add(_pPairing, 64), calldataload(pB))
                mstore(add(_pPairing, 96), calldataload(add(pB, 32)))
                mstore(add(_pPairing, 128), calldataload(add(pB, 64)))
                mstore(add(_pPairing, 160), calldataload(add(pB, 96)))

                mstore(add(_pPairing, 192), alphax)
                mstore(add(_pPairing, 224), alphay)

                mstore(add(_pPairing, 256), betax1)
                mstore(add(_pPairing, 288), betax2)
                mstore(add(_pPairing, 320), betay1)
                mstore(add(_pPairing, 352), betay2)

                mstore(add(_pPairing, 384), mload(add(pMem, pVk)))
                mstore(add(_pPairing, 416), mload(add(pMem, add(pVk, 32))))

                mstore(add(_pPairing, 448), gammax1)
                mstore(add(_pPairing, 480), gammax2)
                mstore(add(_pPairing, 512), gammay1)
                mstore(add(_pPairing, 544), gammay2)

                mstore(add(_pPairing, 576), calldataload(pC))
                mstore(add(_pPairing, 608), calldataload(add(pC, 32)))

                mstore(add(_pPairing, 640), deltax1)
                mstore(add(_pPairing, 672), deltax2)
                mstore(add(_pPairing, 704), deltay1)
                mstore(add(_pPairing, 736), deltay2)

                let success := staticcall(
                    sub(gas(), 2000),
                    8,
                    _pPairing,
                    768,
                    _pPairing,
                    0x20
                )

                isOk := and(success, mload(_pPairing))
            }

            let pMem := mload(0x40)
            mstore(0x40, add(pMem, pLastMem))

            // Validate that all public inputs are within the field
            checkField(calldataload(add(_pubSignals, 0)))
            checkField(calldataload(add(_pubSignals, 32)))
            checkField(calldataload(add(_pubSignals, 64)))
            checkField(calldataload(add(_pubSignals, 96)))

            // Execute final pairing check
            let isValid := checkPairing(_pA, _pB, _pC, _pubSignals, pMem)

            mstore(0, isValid)
            return(0, 0x20)
        }
    }
}

